function NavBar(){
  const logo = "Youness React Site"
  return(
    <nav>
      <span> { logo }</span>
      <div className='links'>
        <a href='/'>Home</a>
        <a href='/gallery'>Gallery</a>
        <a href='/store'>Store</a>
        <a href='/contact'>Contact</a>
      </div>
    </nav>
  )
}


export default NavBar ;
